import Core from './Core.js';
import Misc from './Misc.js';
import OpenGL from './OpenGL.js';
import SceneGraph from './SceneGraph.js';
import WebGPU from './WebGPU.js';

var Rendering = {
  Core: Core,
  Misc: Misc,
  OpenGL: OpenGL,
  SceneGraph: SceneGraph,
  WebGPU: WebGPU
};

export { Rendering as default };
